import React from 'react';
import { useHistory } from 'react-router-dom';

const BackButton = () => {
  const history = useHistory();

  return (
    <div>
      <h1>Current Page</h1>
      <button onClick={() => history.goBack()}>Go Back</button>
    </div>
  );
};

export default BackButton;
